import React, { useEffect, useState } from 'react';
import { Box, Typography, Stack, Chip, Card, CardContent } from '@mui/material';
import TopBar from '../components/TopBar';
import TelemetryPanel from '../components/TelemetryPanel';
import MapView from '../components/MapView';
import AlertsPanel from '../components/AlertsPanel';
import { subscribeToTelemetry } from '../api/socket';

const Home = () => {
  const [telemetry, setTelemetry] = useState(null);
  const [batteryHistory, setBatteryHistory] = useState([]);
  const [temperatureHistory, setTemperatureHistory] = useState([]);
  const [altitudeHistory, setAltitudeHistory] = useState([]);
  const [imuHistory, setImuHistory] = useState([]);

  useEffect(() => {
    const unsubscribe = subscribeToTelemetry((incoming) => {
      setTelemetry(incoming);
      const time = new Date().toLocaleTimeString();

      setBatteryHistory((prev) => [...prev.slice(-20), { time, value: incoming.battery }]);
      setTemperatureHistory((prev) => [...prev.slice(-20), { time, value: incoming.temperature }]);
      setAltitudeHistory((prev) => [...prev.slice(-20), { time, value: incoming.altitude }]);
      setImuHistory((prev) => [
        ...prev.slice(-20),
        { time, roll: incoming.roll, pitch: incoming.pitch, yaw: incoming.yaw },
      ]);
    });

    return () => unsubscribe();
  }, []);

  const chartData = {
    batteryHistory,
    temperatureHistory,
    altitudeHistory,
    imuHistory,
  };

  return (
    <Box sx={{ backgroundColor: '#0f172a', height: '100vh', overflow: 'hidden' }}>
      <TopBar telemetry={telemetry} />

      {/* Body Layout */}
      <Box sx={{ display: 'flex', height: 'calc(100vh - 64px)' }}>
        {/* Telemetry Panel on Left */}
        <Box sx={{ width: '750px', overflowY: 'auto', borderRight: '1px solid #1e293b' }}>
          <TelemetryPanel telemetry={telemetry} chartData={chartData} />
        </Box>

        {/* Right Side: Map + Info */}
        <Box sx={{ flexGrow: 2, p: 5, overflowY: 'auto' }}>
          {/* Section Title */}
          <Typography variant="h5" color="primary" sx={{ mb: 2 }}>
            üó∫ Live Location & Connectivity
          </Typography>

          {/* Alerts Panel */}
          {telemetry && <AlertsPanel telemetry={telemetry} />}

          {/* Connection and GPS Info in separate cards, placed below the alerts */}
          {telemetry && (
            <Stack spacing={3} direction="row" sx={{ mb: 3 }}>
              {/* Connection Card */}
              <Card sx={{ backgroundColor: '#1e293b', color: 'white', minWidth: 200 }}>
                <CardContent>
                  <Typography variant="h6" color="primary">üì° Connection</Typography>
                  <Chip
                    label={telemetry.connection}
                    color={
                      telemetry.connection === 'Excellent'
                        ? 'success'
                        : telemetry.connection === 'Poor'
                        ? 'warning'
                        : 'error'
                    }
                    sx={{ mt: 1 }}
                  />
                </CardContent>
              </Card>

              {/* GPS Card */}
              <Card sx={{ backgroundColor: '#1e293b', color: 'white', minWidth: 250 }}>
                <CardContent>
                  <Typography variant="h6" color="primary">üìç GPS</Typography>
                  <Typography variant="body2" sx={{ color: '#fff' }}>
                    Latitude: {telemetry?.gps?.lat?.toFixed(4)}
                  </Typography>
                  <Typography variant="body2" sx={{ color: '#fff' }}>
                    Longitude: {telemetry?.gps?.lon?.toFixed(4)}
                  </Typography>
                  <Typography variant="body2" sx={{ color: '#fff' }}>
                    Altitude: {telemetry?.gps?.alt?.toFixed(2)} m
                  </Typography>
                </CardContent>
              </Card>
            </Stack>
          )}

          {/* MapView */}
          <MapView telemetry={telemetry} />
        </Box>
      </Box>
    </Box>
  );
};

export default Home;
